import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class HeaderAdmin extends Component {
    render() {
        return (
            <tr>
                <th scope="col">{this.props.stt}</th>
                <th scope="col">{this.props.product.productName}</th>
                <th scope="col">{this.props.product.productPrice}</th>
                <th scope="col"><img src={"images/" + this.props.product.productImage}/></th>
                <th scope="col">{this.props.product.productUnit}</th>
                <th scope="col">{this.props.product.productDescryptions}</th>
                <th scope="col"><NavLink className="fa fa-edit"></NavLink>|<NavLink className="fa fa-delete"></NavLink></th>
                <th></th>
            </tr>
        )
    }
}

export default HeaderAdmin;
